import { useState } from "react";
import { Bell, Users, Calendar, LogOut, Menu, MessageSquare, User } from "lucide-react";

export default function DashboardPage() {
  const [messages, setMessages] = useState([
    { user: "Alice", text: "Hello team!" },
    { user: "Bob", text: "Hi Alice!" },
  ]);
  const [newMessage, setNewMessage] = useState("");

  const handleSendMessage = (e) => {
    e.preventDefault();
    if (!newMessage.trim()) return;
    setMessages([...messages, { user: "You", text: newMessage }]);
    setNewMessage("");
  };

  return (
    <div className="min-h-screen flex bg-gray-100">
      {/* Sidebar */}
      <aside className="w-64 bg-gradient-to-b from-blue-600 via-purple-600 to-pink-600 text-white flex flex-col">
        {/* Logo Section */}
        <div className="p-6 flex flex-col items-center">
          <img
            src="/assets/UpToSkills_Logo.svg"
            alt="Uptoskills Logo"
            className="w-32 h-auto mb-4"
          />
          <div className="text-2xl font-bold">Dashboard</div>
        </div>

        {/* Sidebar Menu */}
        <nav className="flex-1">
          <ul className="space-y-2">
            <li className="flex items-center gap-3 p-3 hover:bg-white/20 cursor-pointer">
              <Menu /> Menu
            </li>
            <li className="flex items-center gap-3 p-3 hover:bg-white/20 cursor-pointer">
              <Users /> Teams
            </li>
            <li className="flex items-center gap-3 p-3 hover:bg-white/20 cursor-pointer">
              <Bell /> Notifications
            </li>
            <li className="flex items-center gap-3 p-3 hover:bg-white/20 cursor-pointer">
              <Calendar /> Calendar
            </li>
            <li className="flex items-center gap-3 p-3 hover:bg-white/20 cursor-pointer">
              <User /> Profile
            </li>
            <li className="flex items-center gap-3 p-3 hover:bg-white/20 cursor-pointer">
              <LogOut /> Logout
            </li>
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Top Bar */}
        <header className="flex justify-between items-center bg-white shadow px-6 py-4">
          <h1 className="text-xl font-bold">Welcome to your Dashboard</h1>
          <div className="relative">
            <Bell className="w-6 h-6 text-gray-700 cursor-pointer" />
            <span className="absolute -top-1 -right-1 bg-red-500 w-3 h-3 rounded-full"></span>
          </div>
        </header>

        {/* Content Area */}
        <main className="flex-1 p-6 overflow-y-auto">
          {/* Chat Section */}
          <div className="bg-white rounded-xl shadow p-4 flex flex-col h-[70vh]">
            <h2 className="font-semibold text-lg mb-4">Team Chat</h2>
            <div className="flex-1 overflow-y-auto mb-4 space-y-2">
              {messages.map((msg, index) => (
                <div
                  key={index}
                  className={`p-2 rounded-lg ${
                    msg.user === "You" ? "bg-blue-100 self-end" : "bg-gray-100"
                  }`}
                >
                  <span className="font-bold">{msg.user}: </span>
                  {msg.text}
                </div>
              ))}
            </div>
            <form className="flex gap-2" onSubmit={handleSendMessage}>
              <input
                type="text"
                className="flex-1 border border-gray-300 rounded-lg px-3 py-2 outline-none"
                placeholder="Type a message..."
                value={newMessage}
                onChange={(e) => setNewMessage(e.target.value)}
              />
              <button className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition">
                Send
              </button>
            </form>
          </div>

          {/* Comments Section */}
          <div className="bg-white rounded-xl shadow p-4 mt-6">
            <h2 className="font-semibold text-lg mb-2">Comments</h2>
            <div className="space-y-2">
              <div className="p-2 bg-gray-100 rounded-lg">
                <span className="font-bold">Alice: </span>Great work team!
              </div>
              <div className="p-2 bg-gray-100 rounded-lg">
                <span className="font-bold">Bob: </span>Let's finish the tasks.
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}
